import Card from '@mui/material/Card';
import { styled } from '@mui/material/styles';

const Home = () => {

    const StyledCard = styled(Card)(({ theme }) => ({
      backgroundColor: 'rgba(0, 0, 0, 0.87)', // Ejemplo de color equivalente a `bg-amber-950`
      color: 'white', // Ajusta el color del texto si es necesario
    }));
    return (
        <StyledCard className='bg-amber-950'>
            <h2>Bienvenido</h2>
        </StyledCard>
    );
}

export default Home;
